import React from "react";
import Image from "next/image";
import foto from "../../../public/img/fotoAlex.jpg";
//import "./Icon.scss";

export const Icon = () => {
  return (
    <div className="icon">
      <Image src={foto} alt="PPPP" width={24} height={24} />
      <p>Arriba se encuentra una imagen</p>
    </div>
  );
};
